import { NEW_POKEMON } from "../types";

export default (state, action) => {
  console.log("Payload and state below");
  console.log(action.payload);
  console.log(state);
  //
  switch (action.type) {
    case NEW_POKEMON:
      return {
        ...state,
        pokemon: action.payload,
      };
  }
};
